import React from "react";

function Login() {
  return (
    <div>
      <h1>Login</h1>
      <div>
        UserName
        <br />
        <input type="text" />
        <br />
        PassWord
        <br />
        <input type="password" />
      </div>
    </div>
  );
}

export default Login;
